import React, { Component } from 'react';
import * as ReactBS from 'react-bootstrap';

// import styles from './Navbar.module.css';

class Menu extends Component {
  render() {
    return (
      <ReactBS.Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <ReactBS.Navbar.Brand href="#home">TEST NAVBAR</ReactBS.Navbar.Brand>
      </ReactBS.Navbar>
    );
  }
}
export default Menu;
